var input = document.querySelector('input');
var preview = document.querySelector('.preview');

input.style.opacity = 0;
input.addEventListener('change', updateImageDisplay);

function updateImageDisplay() {
    while (preview.firstChild) {
        preview.removeChild(preview.firstChild);
    }

    var curFiles = input.files;
    global_curr_file_list = curFiles;

    should_draw_progress_bar = false;

    cancelAnimationFrame(animateid);
    if (clear_timeout_after_done_id != -1) {
        clearTimeout(clear_timeout_after_done_id);
        clear_timeout_after_done_id = -1;
    }
    clear_init("#ffffff");
    process_file_in_progress = false;
    is_startup_progressbar_mode = true;
    current_progressbar_progress = 0.0;
    copyIntoOnscreenCanvas();

    if (curFiles.length === 0) {
        global_curr_file_list = null;
        var para = document.createElement('p');
        para.textContent = 'No files currently selected for upload';
        preview.appendChild(para);
    } else {
        var list = document.createElement('ol');
        preview.appendChild(list);
        for (var i = 0; i < curFiles.length; i++) {

            if (curFiles[i].size > (custom_heap_limit * 0.75) | 0) {
                window.alert("Files of maximum size of " + returnFileSize((custom_heap_limit * 0.75) | 0) + " are supported in this web application");
                global_curr_file_list = null;
                var para = document.createElement('p');
                para.textContent = 'No files currently selected for upload';
                preview.appendChild(para);
                return;
            }

            var listItem = document.createElement('li');
            var para = document.createElement('p');  

            para.textContent = '' + curFiles[i].name + ', size : ' + returnFileSize(curFiles[i].size) + '.';
            var namelower = (curFiles[i].name).toLowerCase();
            if (namelower.indexOf(".png") !== -1 || namelower.indexOf(".jpeg") !== -1 || namelower.indexOf(".jpg") !== -1 || namelower.indexOf(".bmp") !== -1 || namelower.indexOf(".ico") !== -1) {
                var image = document.createElement('img');
                image.src = window.URL.createObjectURL(curFiles[i]);
                listItem.appendChild(image);
            }
            listItem.appendChild(para);
            list.appendChild(listItem);
        }
    }
}

function returnFileSize(number) {
    if (number < 1024) {
        return number + ' bytes';
    } else if (number >= 1024 && number < 1048576) {
        return (number / 1024).toFixed(1) + ' KB';
    } else if (number >= 1048576) {
        return (number / 1048576).toFixed(1) + ' MB';
    }
}

lastfps = 16;
lasterr = 50;
lastqrsize = 585;
laststartupsec = 6;

function fpschanged() {
	if(!validate_input())
		return;
    var numberfps = document.getElementById("numberfps");
    var nfps = Number(numberfps.value) | 0;
    fps = nfps;
    fpsInterval = 1000 / fps;
    last_set_fps
    save_settings();
    document.getElementById("uplspeedtxt").innerHTML = "Max upload speed : <b>" + calc_uplspeed() + "</b>";
}

function calc_uplspeed() {
    var numberfps = document.getElementById("numberfps");
    var numbererr = document.getElementById("numbererr");
    var numberqrsize = document.getElementById("numberqrsize");
    var nfps = Number(numberfps.value) | 0;
    var nerr = Number(numbererr.value) | 0;
    var nqr = Number(numberqrsize.value) | 0;
    var number = ((1 - (nerr / 100.0)) * (nqr - 4) * nfps);
    if (number < 1024) {
        return number.toFixed(0) + " B/s";
    } else if (number >= 1024 && number < 1048576) {
        return (number / 1024).toFixed(2) + " KB/s";
    } else if (number >= 1048576) {
        return (number / 1048576).toFixed(2) + " MB/s";
    }
}

function validate_component(component_string, warn_msg, range_min, range_max, defvalue){
	var numbercomp = document.getElementById(component_string);
	if (numbercomp.value.trim() === "") {
        alert(warn_msg);
        numbercomp.focus();
		numbercomp.value = defvalue;
		document.getElementById("uplspeedtxt").innerHTML = "Max upload speed : <b>" + calc_uplspeed() + "</b>";
        return false;
    }
    if (numbercomp.value !== "") {
        if (! (/^\d*(?:\.\d{0,2})?$/.test(numbercomp.value))) {
            alert(warn_msg);
            numbercomp.focus();
			numbercomp.value = defvalue;
			document.getElementById("uplspeedtxt").innerHTML = "Max upload speed : <b>" + calc_uplspeed() + "</b>";
            return false;
        }else{
			var nfps = Number(numbercomp.value) | 0
			if (nfps > range_max || nfps < range_min){
				alert(warn_msg);
				numbercomp.focus();
				numbercomp.value = defvalue;
				document.getElementById("uplspeedtxt").innerHTML = "Max upload speed : <b>" + calc_uplspeed() + "</b>";
				return false;
			}
		}
    }
    return true;  
}

function validate_input(){
	if (!validate_component("numberfps", "Please enter a valid FPS number from 5-60 range!", 5, 60, lastfps))
		return false;
	if (!validate_component("numbererr", "Please enter a valid maximum error fraction from 20% to 80%", 20, 80, lasterr))
		return false;
	if (!validate_component("numberqrsize", "Please enter a valid single QR size in bytes from 85 to 1625", 85, 1625, lastqrsize))
		return false;
	if (!validate_component("numberstartupsec", "Please enter a valid time(seconds) of initializing startup sequence", 3, 10, laststartupsec))
		return false;
	return true;
}

