    }
    clear_init("#ffffff");
    process_file_in_progress = false;
    is_startup_progressbar_mode = true;
    current_progressbar_progress = 0.0;
    copyIntoOnscreenCanvas();
    save_settings();
    document.getElementById("uplspeedtxt").innerHTML = "Max upload speed : <b>" + calc_uplspeed() + "</b>";
}

is_initialized_once = false;
is_startup_progressbar_mode = false;
current_progressbar_progress = 0.0;
progressbar_text = "Progress..";
should_draw_progress_bar = false;

total_number_dataframes = -1;
curr_dataframe_index = -1;

function copyIntoOnscreenCanvas() {
    var onscreenContext = qrcanvas.getContext('2d');
    //draw progressbar
    progbar_height = 0;
    progbar_height = qrcanvas.height - qrcanvas.width;
    if (progbar_height > 60)
        progbar_height = progbar_height - 30;
    lrmargin = 20;
    if (should_draw_progress_bar && progbar_height > 20) {
        onscreenContext.fillStyle = "#aaaaaa";
        var greyx = lrmargin;
        greyy = (progbar_height * 0.1) | 0;
        greyw = qrcanvas.width - 2 * lrmargin;
        greyh = 35;
        onscreenContext.fillRect(greyx, greyy, greyw, greyh);
        onscreenContext.font = "17pt Arial";
        if (is_startup_progressbar_mode) {
            onscreenContext.fillStyle = "#ffa500";
            onscreenContext.fillRect(greyx + 2 + ((1.0 - current_progressbar_progress) * (greyw - 4)) | 0, greyy + 2, (current_progressbar_progress * (greyw - 4)) | 0, greyh - 4);
            onscreenContext.fillStyle = "#000000";
            mt = onscreenContext.measureText(progressbar_text);
            fy = parseInt(onscreenContext.font) - 7;
            onscreenContext.fillText(progressbar_text, (0.5 * qrcanvas.width - 0.5 * mt.width) | 0, greyy + (0.5 * greyh + 0.5 * fy) | 0);
            onscreenContext.fillText(progressbar_text, (0.5 * qrcanvas.width - 0.5 * mt.width) | 0, greyy + (0.5 * greyh + 0.5 * fy) | 0);
        } else {
            onscreenContext.fillStyle = "#0077ff";
            onscreenContext.fillRect(greyx + 2, greyy + 2, (current_progressbar_progress * (greyw - 4)) | 0, greyh - 4);
            onscreenContext.fillStyle = "#000000";
            mt = onscreenContext.measureText(progressbar_text);
            fy = parseInt(onscreenContext.font) - 7;
            onscreenContext.fillText(progressbar_text, (0.5 * qrcanvas.width - 0.5 * mt.width) | 0, greyy + (0.5 * greyh + 0.5 * fy) | 0);
            onscreenContext.fillText(progressbar_text, (0.5 * qrcanvas.width - 0.5 * mt.width) | 0, greyy + (0.5 * greyh + 0.5 * fy) | 0);
            //.width
        }
    } else {
        onscreenContext.fillStyle = "#ffffff";
        onscreenContext.fillRect(0, 0, qrcanvas.width, progbar_height);
    }
    //
    onscreenContext.imageSmoothingEnabled = false;
    onscreenContext.webkitImageSmoothingEnabled = false;
    var offscreenContext = offscreenqrCanvas.getContext('2d');
    var image = offscreenContext.getImageData(0, 0, qrcanvas.width, qrcanvas.height);
    onscreenContext.putImageData(image, (extra_margin / 2) | 0, progbar_height + (extra_margin / 2) | 0);
}

function clear_init(style) {
    var context = offscreenqrCanvas.getContext('2d');
    context.fillStyle = style;
    context.fillRect(0, 0, qrcanvas.width, qrcanvas.height);
    copyIntoOnscreenCanvas();
}

function draw_qr(size_sq, datastart) {
    var context = offscreenqrCanvas.getContext('2d');
    context.imageSmoothingEnabled = false;
    context.webkitImageSmoothingEnabled = false;
    context.mozImageSmoothingEnabled = false;
    context.webkitImageSmoothingEnabled = false;
    context.msImageSmoothingEnabled = false;
    context.imageSmoothingEnabled = false;
    context.fillStyle = "#ffffff";
    context.fillRect(0, 0, qrcanvas.width, qrcanvas.height);
    context.fillStyle = "#000000";
    var size = offscreenqrCanvas.width;
    if (offscreenqrCanvas.width > offscreenqrCanvas.height)
        size = offscreenqrCanvas.height;
    var delta_area = (size / size_sq) | 0; // cast from double to int
    extra_margin = size - delta_area * size_sq;
    var offset = datastart | 0;

    for (var i = 0; i < size_sq; i++) {
        for (var j = 0; j < size_sq; j++) {
            if (HEAP8[offset] == 0)
                context.fillRect(i * delta_area, j * delta_area, delta_area, delta_area);
            offset++;
        }
    }
    copyIntoOnscreenCanvas();
}

function setup_layout() {
    document.getElementById("defsettingbutton").onclick = set_default_settings;
    var qrarea = document.getElementById("qrarea");
    qrcanvas = document.getElementById("qrcanvas");
    var maincontrolarea = document.getElementById("maincontrolarea");
    var pageWidth = window.innerWidth;
    var pageHeight = window.innerHeight;
    if (pageWidth / pageHeight > 1.0) {
        qrarea.className = "fullsquareH";
        qrarea.style.float = "left";
        maincontrolarea.style.float = "left";
        maincontrolarea.style = "float:left;margin-right:50;margin-left:50;";
        document.getElementById("qrcanvas").style = "image-rendering: optimizeSpeed; image-rendering: -moz-crisp-edges; image-rendering: -webkit-optimize-contrast;image-rendering: -o-crisp-edges; image-rendering: pixelated; -ms-interpolation-mode: nearest-neighbor;";;
    } else {
        qrarea.className = "fullsquareW";
        qrarea.style.float = "top";
        maincontrolarea.style.float = "top";
        document.getElementById("qrcanvas").style = "image-rendering: optimizeSpeed; image-rendering: -moz-crisp-edges; image-rendering: -webkit-optimize-contrast;image-rendering: -o-crisp-edges; image-rendering: pixelated; -ms-interpolation-mode: nearest-neighbor;";
    }
    qrcanvas.width = qrarea.clientWidth;
    qrcanvas.height = qrarea.clientHeight;
    offscreenqrCanvas = document.createElement('canvas');
    offscreenqrCanvas.width = qrcanvas.width;
    offscreenqrCanvas.height = qrcanvas.height;
    clear_init("#ffffff");
}

window.onresize = function() {
    setup_layout();
}

