extratime = 0;

function animate() {
    if (cancel_animation)
        return;
    // request another frame
    animateid = requestAnimationFrame(animate);
    // calc elapsed time since last loop
    now = Date.now();
    elapsed = now - then;
    if (is_startup_progressbar_mode) {
        var diff_from_start_s = (now - startTime) / 1000.0;
        current_progressbar_progress = diff_from_start_s / sec_startup_time;
        if (current_progressbar_progress > 1.0)
            current_progressbar_progress = 1.0;
        var tleft = sec_startup_time - diff_from_start_s;
        if (tleft < 0) {
            is_startup_progressbar_mode = false;
            tleft = 0;
            extratime = 80;
        }
        var fnameshort = "";
        if (global_curr_file_list != null) {
            fnameshort = global_curr_file_list[curr_file_uploading_index].name;
            if (fnameshort.length > 22)
                fnameshort = fnameshort.substring(0, 22) + "..";
        }
        progressbar_text = "Startup sequence(" + fnameshort + "): " + (tleft.toFixed(1)) + "s";

    }

    // if enough time has elapsed, draw the next frame
    if (elapsed > fpsInterval + extratime) {

        if (is_startup_progressbar_mode == false && curr_dataframe_index == 0 && total_number_dataframes != -1) {
            _tell_no_more_generating_header();
        }

        if (is_startup_progressbar_mode == false) {
            a32 = _malloc(8);
            var stat = _produce_next_qr_grayscale_image_to_mem(a32, a32 + 4);
            curr_dataframe_index++;
            if ((curr_dataframe_index % (Math.pow(2, npow) - 1)) == 1) {
                extratime = 80;
            } else {
                extratime = 0;
            }

            if (stat > 0) {
                cancelAnimationFrame(animateid);
                clear_timeout_after_done_id = setTimeout(function() {
                    should_draw_progress_bar = false;
                    clear_init("#ffffff");
                    clear_timeout_after_done_id = -1;
                    if (global_curr_file_list != null)
                        if (curr_file_uploading_index + 1 < global_curr_file_list.length) {
                            curr_file_uploading_index++;

                            triggerfile_upl(false);
                        }
                }, 2500);

            }
            current_progressbar_progress = (curr_dataframe_index - 1) / total_number_dataframes;
            current_progressbar_progress = Math.min(Math.max(current_progressbar_progress, 0), 1);

            var fnameshort = "";
            if (global_curr_file_list != null) {
                fnameshort = global_curr_file_list[curr_file_uploading_index].name;
                if (fnameshort.length > 22)
                    fnameshort = fnameshort.substring(0, 22) + "..";
            }
            progressbar_text = "Sending file " + fnameshort + " : " + ((current_progressbar_progress * 100).toFixed(1)) + "%";
            var dataoff = dereference_addr32(a32);
            var size_px = dereference_addr32(a32 + 4);
            draw_qr(size_px, dataoff);
            _free(a32);
            a32 = 0;
        } else {
            a32 = _malloc(8);
            _produce_next_qr_grayscale_image_to_mem(a32, a32 + 4);
            var dataoff = dereference_addr32(a32);
            var size_px = dereference_addr32(a32 + 4);
            draw_qr(size_px, dataoff);
            _free(a32);
            a32 = 0;
        }

        then = now - (elapsed % fpsInterval);

    }
}

var txt1 = 0;
var txt2 = 0;
var a32 = 0;
var encoder_inited = false;
