curr_file_uploading_index = 0;

function triggerfile_upl(frombutton) {
    if (process_file_in_progress == true)
        return;
    process_file_in_progress = true;
    if (clear_timeout_after_done_id != -1) {
        clearTimeout(clear_timeout_after_done_id);
        clear_timeout_after_done_id = -1;
    }
    if (global_curr_file_list == null) {
        window.alert("Select some files first !");
        process_file_in_progress = false;
        return;
    }

    cancel_animation = true;
    cancelAnimationFrame(animateid);
    progressbar_text = "Preparing file.."
    is_startup_progressbar_mode = true;
    current_progressbar_progress = 0.0;
    copyIntoOnscreenCanvas();
    if (frombutton) {
        curr_file_uploading_index = 0;
        document.getElementById("qrcanvas").focus();
        location.href = "#qrcanvas";
    }
    globalFileReader = new FileReader();
    globalFileReader.onload = function(e) {
        progressbar_text = "Startup sequence..";
        should_draw_progress_bar = true;
        is_startup_progressbar_mode = true;
        current_progressbar_progress = 0.0;
        copyIntoOnscreenCanvas();
        var arrayBuffer = globalFileReader.result;
        var b8data = new Uint8Array(arrayBuffer)
        //window.alert("Done reading.., size "+b8data.length);
        var fname = global_curr_file_list[curr_file_uploading_index].name;
        var qrs = Number(document.getElementById("numberqrsize").value) | 0;
        var errrat = (Number(document.getElementById("numbererr").value) | 0) / 100.0;
        sec_startup_time = Number(document.getElementById("numberstartupsec").value) | 0;
        memset_file_allocate(b8data, global_curr_file_list[curr_file_uploading_index]);
        initialize_file(fname, qrs, errrat, sec_startup_time);
        total_number_dataframes = _tell_how_much_frames_will_be_generated();
        curr_dataframe_index = 0;
        var fps = Number(document.getElementById("numberfps").value) | 0;
        startAnimating(fps);

        process_file_in_progress = false;
    }
    //read first
    if (global_curr_file_list != null && global_curr_file_list.length > 0)
        globalFileReader.readAsArrayBuffer(global_curr_file_list[curr_file_uploading_index]);
}

function memset_file_allocate(arr, file) {
    GlobalFile.size = arr.length;
    if (GlobalFile.beginning_file_memaddr != 0) {
        _free(GlobalFile.beginning_file_memaddr);
    }
    GlobalFile.beginning_file_memaddr = _malloc(arr.length);
    GlobalFile.current_memaddr_file = GlobalFile.beginning_file_memaddr;
    for (var j = 0; j < arr.length; j++)
        Module.HEAP8[GlobalFile.beginning_file_memaddr + j] = arr[j];
}

