var npow = 9;

function initialize_file(filename, qrsize, errratio, sec_startup) {
    if (encoder_inited) {
        deinitialize_file();
        encoder_inited = false;
    }
    sec_startup_time = sec_startup;
    txt1 = spare_allocateUTF8(filename);
    txt2 = spare_allocateUTF8("/");
    a32 = _malloc(8);
    _init_and_set_external_file_info(txt1, txt2, qrsize, errratio, (Math.pow(2, npow) - 1) | 0);
    encoder_inited = true;
};

function deinitialize_file() {
    if (encoder_inited == false)
        return;
    if (a32 != 0)
        _free(a32);
    if (txt1 > 0)
        _free(txt1);
    if (txt2 > 0)
        _free(txt2);
    a32 = 0;
    _destroy_current_encoder();
    encoder_inited = false;
};


window.onbeforeunload = function() {
    save_settings();
    return '';
};
